\u043d\u0442\u0430 \u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0438\u044f\u043c\u0438 \u0434\u043b\u044f \u043f\u0440\u0438\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u0438\u044f \u0443 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u00ab\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u043e\u0439 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438\u00bb \u043f\u0440\u0430\u0432 \u043d\u0430 \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u043a\u0430\u043d\u0430\u043b\u0430 \u0438 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0438<\/a> \u043f\u0440\u0430\u0432\u0430 \u043d\u0430 \u0432\u0435\u0447\u043d\u043e\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u0437\u043e\u043d\u043e\u0439 \u043a\u0430\u043d\u0430\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904_%D0%B3%D0%BE%D0%B4\" title=\"1904 \u0433\u043e\u0434\">1904<\/a>&#160;\u2014 \u043e\u0434\u043d\u043e \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D0%BF%D0%BD%D0%B5%D0%B9%D1%88%D0%B8%D0%B5_%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D1%8B_XX_%D0%B2%D0%B5%D0%BA%D0%B0\" title=\"\u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0435 \u043c\u043e\u0440\u0441\u043a\u0438\u0435 \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u044b XX \u0432\u0435\u043a\u0430\">\u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0438\u0445 \u043a\u043e\u0440\u0430\u0431\u043b\u0435\u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0439 XX \u0432\u0435\u043a\u0430<\/a>: \u043d\u043e\u0440\u0432\u0435\u0436\u0441\u043a\u043e\u0435 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Norge_(%D0%BF%D0%B0%D1%80%D0%BE%D1%85%D0%BE%D0%B4)\" title=\"Norge (\u043f\u0430\u0440\u043e\u0445\u043e\u0434)\">\u041d\u043e\u0440\u0434\u0436<\/a>\u00bb \u0440\u0430\u0437\u0431\u0438\u043b\u043e\u0441\u044c \u043d\u0430 \u0440\u0438\u0444\u0430\u0445 \u0431\u043b\u0438\u0437 \u043e\u0441\u0442\u0440\u043e\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%BA%D0%BE%D0%BB%D0%BB\" title=\"\u0420\u043e\u043a\u043e\u043b\u043b\">\u0420\u043e\u043a\u043e\u043b\u043b<\/a>; \u0442\u0440\u0430\u0433\u0435\u0434\u0438\u044f \u0443\u043d\u0435\u0441\u043b\u0430 \u0436\u0438\u0437\u043d\u0438 635 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a> \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u044b \u043f\u043e\u0441\u0442\u044b \u043c\u0438\u0440\u043e\u0432\u044b\u0445 \u0441\u0443\u0434\u0435\u0439, \u0443\u043f\u0440\u0430\u0437\u0434\u043d\u0435\u043d\u043d\u044b\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1889_%D0%B3%D0%BE%D0%B4\" title=\"1889 \u0433\u043e\u0434\">1889 \u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B0%D0%B5%D0%B2%D0%BE\" title=\"\u0421\u0430\u0440\u0430\u0435\u0432\u043e\">\u0421\u0430\u0440\u0430\u0435\u0432\u0435<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e \u043f\u043e\u043a\u0443\u0448\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B8%D0%BD%D1%86%D0%B8%D0%BF,_%D0%93%D0%B0%D0%B2%D1%80%D0%B8%D0%BB%D0%BE\" title=\"\u041f\u0440\u0438\u043d\u0446\u0438\u043f, \u0413\u0430\u0432\u0440\u0438\u043b\u043e\">\u0413\u0430\u0432\u0440\u0438\u043b\u044b \u041f\u0440\u0438\u043d\u0446\u0438\u043f\u0430<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u043e\u0433\u043e<\/a> \u043f\u0440\u0435\u0441\u0442\u043e\u043b\u043e\u043d\u0430\u0441\u043b\u0435\u0434\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86_%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4,_%D1%8D%D1%80%D1%86%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u0424\u0440\u0430\u043d\u0446 \u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434, \u044d\u0440\u0446\u0433\u0435\u0440\u0446\u043e\u0433 \u0410\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u0439\">\u044d\u0440\u0446\u0433\u0435\u0440\u0446\u043e\u0433\u0430 \u0424\u0440\u0430\u043d\u0446\u0430 \u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434\u0430<\/a> \u0438 \u0435\u0433\u043e \u0436\u0435\u043d\u0443 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%80%D0%B0%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D0%B1%D0%B8%D0%B9%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0421\u0430\u0440\u0430\u0435\u0432\u0441\u043a\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e\">\u0421\u0430\u0440\u0430\u0435\u0432\u0441\u043a\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e<\/a>), \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0432\u0448\u0435\u0435 \u043f\u043e\u0432\u043e\u0434\u043e\u043c \u043a \u043d\u0430\u0447\u0430\u043b\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a><ul><li>\u041f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%81%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_(1919)\" class=\"mw-redirect\" title=\"\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 (1919)\">\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u0443\u044e \u043c\u0438\u0440\u043e\u0432\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li>\u041e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%BD%D0%B0%D1%86%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u041b\u0438\u0433\u0430 \u043d\u0430\u0446\u0438\u0439\">\u041b\u0438\u0433\u0430 \u043d\u0430\u0446\u0438\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_I_%D0%9A%D0%B0%D1%80%D0%B0%D0%B3%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I \u041a\u0430\u0440\u0430\u0433\u0435\u043e\u0440\u0433\u0438\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 I \u041a\u0430\u0440\u0430\u0433\u0435\u043e\u0440\u0433\u0438\u0435\u0432\u0438\u0447<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b \u043d\u043e\u0432\u044b\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0443\u0441\u0442\u0430\u0432 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u0430 \u0441\u0435\u0440\u0431\u043e\u0432, \u0445\u043e\u0440\u0432\u0430\u0442\u043e\u0432 \u0438 \u0441\u043b\u043e\u0432\u0435\u043d\u0446\u0435\u0432. \u0423\u0441\u0442\u0430\u0432 \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u00ab\u0412\u0438\u0434\u043e\u0432\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438\u00bb \u043f\u043e \u0438\u043c\u0435\u043d\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%B4%D0%BE%D0%B2%D0%B4%D0%B0%D0%BD\" title=\"\u0412\u0438\u0434\u043e\u0432\u0434\u0430\u043d\">\u043f\u0440\u0430\u0437\u0434\u043d\u0438\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u043f\u0440\u043e\u043a\u0443\u0440\u0430\u0442\u0443\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 \u00ab\u0418\u0437\u0432\u0435\u0441\u0442\u0438\u044f\u00bb \u043e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043b\u0438 \u043e\u0431\u0440\u0430\u0449\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%BE%D0%BD_(%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u0422\u0438\u0445\u043e\u043d (\u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445 \u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439)\">\u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0430 \u0422\u0438\u0445\u043e\u043d\u0430<\/a> \u043a \u00ab\u0430\u0440\u0445\u0438\u043f\u0430\u0441\u0442\u044b\u0440\u044f\u043c, \u043f\u0430\u0441\u0442\u044b\u0440\u044f\u043c \u0438 \u043f\u0430\u0441\u043e\u043c\u044b\u043c \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438 \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439\u00bb, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043e\u043d \u0437\u0430\u044f\u0432\u0438\u043b \u043e \u043f\u0440\u0438\u0437\u043d\u0430\u043d\u0438\u0438 \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u0448\u0438\u0440\u043e\u043a\u043e\u043c\u0430\u0441\u0448\u0442\u0430\u0431\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u043f\u043e \u0430\u0440\u0435\u0441\u0442\u0443 \u0438 \u0432\u044b\u0441\u044b\u043b\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%8B%D0%B3%D0%B0%D0%BD%D0%B5\" title=\"\u0426\u044b\u0433\u0430\u043d\u0435\">\u0446\u044b\u0433\u0430\u043d<\/a> (\u0432 \u0445\u043e\u0434\u0435 \u0435\u0451 \u0431\u044b\u043b\u0438 \u0434\u0435\u043f\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u0430\u043d\u044b 5470 \u0447\u0435\u043b\u043e\u0432\u0435\u043a).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%9A%D0%9A%D0%90\" class=\"mw-redirect\" title=\"\u0420\u041a\u041a\u0410\">\u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B8%D1%81%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%91%D0%B5%D1%81%D1%81%D0%B0%D1%80%D0%B0%D0%B1%D0%B8%D0%B8_%D0%B8_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%BE%D0%B9_%D0%91%D1%83%D0%BA%D0%BE%D0%B2%D0%B8%D0%BD%D1%8B_%D0%BA_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0435 \u0411\u0435\u0441\u0441\u0430\u0440\u0430\u0431\u0438\u0438 \u0438 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0411\u0443\u043a\u043e\u0432\u0438\u043d\u044b \u043a \u0421\u0421\u0421\u0420\">\u0432\u0441\u0442\u0443\u043f\u0438\u043b\u0438 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u044e \u0411\u0435\u0441\u0441\u0430\u0440\u0430\u0431\u0438\u0438 \u0438 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0411\u0443\u043a\u043e\u0432\u0438\u043d\u044b<\/a> \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F\" title=\"\u0420\u0443\u043c\u044b\u043d\u0438\u044f\">\u0420\u0443\u043c\u044b\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0451\u043d \u043e\u0442 \u0444\u0438\u043d\u0441\u043a\u0438\u0445 \u0437\u0430\u0445\u0432\u0430\u0442\u0447\u0438\u043a\u043e\u0432 \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4%D1%81%D0%BA\" title=\"\u041f\u0435\u0442\u0440\u043e\u0437\u0430\u0432\u043e\u0434\u0441\u043a\">\u041f\u0435\u0442\u0440\u043e\u0437\u0430\u0432\u043e\u0434\u0441\u043a<\/a>&#160;\u2014 \u0441\u0442\u043e\u043b\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B5%D0%BB%D0%BE-%D0%A4%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u041a\u0430\u0440\u0435\u043b\u043e-\u0424\u0438\u043d\u0441\u043a\u0430\u044f \u0421\u0421\u0420\">\u041a\u0430\u0440\u0435\u043b\u043e-\u0424\u0438\u043d\u0441\u043a\u043e\u0439 \u0421\u0421\u0420<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1948_%D0%B3%D0%BE%D0%B4\" title=\"1948 \u0433\u043e\u0434\">1948<\/a>&#160;\u2014 \u0438\u043d\u0444\u043e\u0440\u043c\u0431\u044e\u0440\u043e \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0438 \u0440\u0430\u0431\u043e\u0447\u0438\u0445 \u043f\u0430\u0440\u0442\u0438\u0439 \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u043b\u043e \u0438\u0437 \u0441\u0432\u043e\u0435\u0433\u043e \u0441\u043e\u0441\u0442\u0430\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%BA%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%BE%D0%B2_%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D0%B8\" title=\"\u0421\u043e\u044e\u0437 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u043e\u0432 \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438\">\u0421\u043e\u044e\u0437 \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u043e\u0432 \u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0438<\/a>. \u041f\u043e\u0432\u043e\u0434\u043e\u043c \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u043b \u043e\u0442\u043a\u0430\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%B7_%D0%A2%D0%B8%D1%82%D0%BE,_%D0%98%D0%BE%D1%81%D0%B8%D0%BF\" title=\"\u0411\u0440\u043e\u0437 \u0422\u0438\u0442\u043e, \u0418\u043e\u0441\u0438\u043f\">\u0418\u043e\u0441\u0438\u043f\u0430 \u0411\u0440\u043e\u0437 \u0422\u0438\u0442\u043e<\/a> (Josip Broz Tito) \u0441\u0442\u0440\u043e\u0433\u043e \u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u044c \u0441\u0442\u0430\u043b\u0438\u043d\u0441\u043a\u0438\u043c \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0438\u044f\u043c. \u0414\u043e\u0433\u043e\u0432\u043e\u0440 \u043e \u0434\u0440\u0443\u0436\u0431\u0435 \u0438 \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u0435 \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B3%D0%BE%D1%81%D0%BB%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u044f\">\u042e\u0433\u043e\u0441\u043b\u0430\u0432\u0438\u0435\u0439<\/a> \u0431\u044b\u043b \u0440\u0430\u0441\u0442\u043e\u0440\u0433\u043d\u0443\u0442. \u0412\u0441\u043a\u043e\u0440\u0435 \u0432 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u043f\u0435\u0447\u0430\u0442\u0438 \u0422\u0438\u0442\u043e \u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043b\u0441\u044f \u0435\u0434\u0432\u0430 \u043b\u0438 \u043d\u0435 \u0444\u0430\u0448\u0438\u0441\u0442\u043e\u043c. \u041b\u0438\u0448\u044c \u043f\u043e\u0441\u043b\u0435 \u0441\u043c\u0435\u0440\u0442\u0438 \u0432\u043e\u0436\u0434\u044f \u0432\u0441\u0435\u0445 \u043d\u0430\u0440\u043e\u0434\u043e\u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u044f \u043c\u0435\u0436\u0434\u0443 \u0434\u0432\u0443\u043c\u044f \u0441\u0442\u0440\u0430\u043d\u0430\u043c\u0438 \u0432\u043d\u043e\u0432\u044c \u0432\u043e\u0448\u043b\u0438 \u0432 \u043d\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e\u0435 \u0440\u0443\u0441\u043b\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u044c<\/a> \u0430\u043d\u043d\u0435\u043a\u0441\u0438\u0440\u043e\u0432\u0430\u043b \u0432\u043e\u0441\u0442\u043e\u0447\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B5%D1%80%D1%83%D1%81%D0%B0%D0%BB%D0%B8%D0%BC\" title=\"\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c\">\u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D1%83%D0%BD%D0%B2%D0%BE%D0%BB%D0%BB%D1%81%D0%BA%D0%B8%D0%B5_%D0%B1%D1%83%D0%BD%D1%82%D1%8B\" title=\"\u0421\u0442\u043e\u0443\u043d\u0432\u043e\u043b\u043b\u0441\u043a\u0438\u0435 \u0431\u0443\u043d\u0442\u044b\">\u0421\u0442\u043e\u0443\u043d\u0432\u043e\u043b\u043b\u0441\u043a\u0438\u0445 \u0431\u0443\u043d\u0442\u043e\u0432<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0441\u043a\u043e\u043c<\/a> \u0440\u0430\u0439\u043e\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%BD%D0%B2%D0%B8%D1%87-%D0%92%D0%B8%D0%BB%D0%BB%D0%B8%D0%B4%D0%B6\" title=\"\u0413\u0440\u0438\u043d\u0432\u0438\u0447-\u0412\u0438\u043b\u043b\u0438\u0434\u0436\">\u0413\u0440\u0438\u043d\u0432\u0438\u0447 \u0412\u0438\u043b\u043b\u0438\u0434\u0436<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%85%D1%8D%D1%82%D1%82%D0%B5%D0%BD\" title=\"\u041c\u0430\u043d\u0445\u044d\u0442\u0442\u0435\u043d\">\u041c\u0430\u043d\u0445\u044d\u0442\u0442\u0435\u043d<\/a>). \u0412 \u043d\u043e\u0447\u044c \u043d\u0430 28 \u0438\u044e\u043d\u044f \u043f\u043e\u0441\u0435\u0442\u0438\u0442\u0435\u043b\u0438 \u043a\u043b\u0443\u0431\u0430 \u00abStonewall Inn\u00bb \u043d\u0430 Christopher street \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043e\u043a\u0430\u0437\u0430\u043b\u0438 \u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0435 \u0441\u043e\u043f\u0440\u043e\u0442\u0438\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u043e\u043b\u0438\u0446\u0438\u0438, \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0432\u0448\u0435\u0439 \u043e\u0447\u0435\u0440\u0435\u0434\u043d\u0443\u044e \u043e\u0431\u043b\u0430\u0432\u0443. \u0421\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u0438\u0441\u044c \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0434\u043d\u0435\u0439. \u042d\u0442\u0438 \u0434\u0430\u0442\u044b \u0441\u0447\u0438\u0442\u0430\u044e\u0442\u0441\u044f \u0442\u043e\u0447\u043a\u043e\u0439 \u043e\u0442\u0441\u0447\u0451\u0442\u0430 \u0434\u043b\u044f \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e (\u0430 \u0432\u043e \u043c\u043d\u043e\u0433\u043e\u043c \u0438 \u043c\u0438\u0440\u043e\u0432\u043e\u0433\u043e) <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%B9-%D0%B4%D0%B2%D0%B8%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" class=\"mw-redirect\" title=\"\u0413\u0435\u0439-\u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435\">\u0413\u0435\u0439-\u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-14_%D0%BF%D0%BE%D0%B4_%D0%A2%D0%B0%D0%BB%D0%B0%D1%81%D0%BE%D0%BC\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-14 \u043f\u043e\u0434 \u0422\u0430\u043b\u0430\u0441\u043e\u043c\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u0418\u043b-14<\/a> \u0432 \u041a\u0438\u0440\u0433\u0438\u0437\u0441\u043a\u043e\u0439 \u0421\u0421\u0420. 40 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1975_%D0%B3%D0%BE%D0%B4\" title=\"1975 \u0433\u043e\u0434\">1975<\/a>&#160;\u2014 \u0433\u0440\u0443\u043f\u043f\u0430 \u00ab10cc\u00bb \u0432\u043e \u0432\u0442\u043e\u0440\u043e\u0439 (\u0438 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439) \u0440\u0430\u0437 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u043b\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u0445\u0438\u0442-\u043f\u0430\u0440\u0430\u0434 \u0441 \u043f\u0435\u0441\u043d\u0435\u0439 \u00abI-m Not in Love\u00bb, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u043f\u043e \u0438\u0442\u043e\u0433\u0430\u043c \u0433\u043e\u0434\u0430 \u0431\u0443\u0434\u0435\u0442 \u043d\u0430\u0437\u0432\u0430\u043d\u0430 \u043b\u0443\u0447\u0448\u0435\u0439 \u0432 \u043e\u043f\u0440\u043e\u0441\u0435 \u0441\u0430\u043c\u043e\u0433\u043e \u0430\u0432\u0442\u043e\u0440\u0438\u0442\u0435\u0442\u043d\u043e\u0433\u043e \u0432 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u0435\u0436\u0435\u043d\u0435\u0434\u0435\u043b\u044c\u043d\u0438\u043a\u0430 \u00abMelody Maker\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1982_%D0%B3%D0%BE%D0%B4\" title=\"1982 \u0433\u043e\u0434\">1982<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%AF%D0%BA-42_%D0%BF%D0%BE%D0%B4_%D0%9D%D0%B0%D1%80%D0%BE%D0%B2%D0%BB%D0%B5%D0%B9\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u042f\u043a-42 \u043f\u043e\u0434 \u041d\u0430\u0440\u043e\u0432\u043b\u0435\u0439\">\u043f\u0435\u0440\u0432\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 \u042f\u043a-42<\/a>&#160;\u2014 \u043a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u0438 (132 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 XIX \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u041a\u041f\u0421\u0421<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0440\u0435\u0444\u043e\u0440\u043c\u044b \u0432 \u0421\u0421\u0421\u0420. \u0412\u044b\u0441\u0442\u0443\u043f\u0430\u044f \u043d\u0430 XIX \u041f\u0430\u0440\u0442\u0438\u0439\u043d\u043e\u0439 \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u0438 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 (\u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%B8%D1%8E%D0%BB%D1%8F\" title=\"1 \u0438\u044e\u043b\u044f\">1 \u0438\u044e\u043b\u044f<\/a>), <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432<\/a> \u0438\u0437\u043b\u043e\u0436\u0438\u043b \u043f\u043b\u0430\u043d \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u0439 \u0432 \u0430\u0434\u043c\u0438\u043d\u0438\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043d\u043e\u0439 \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0435 \u0441\u0442\u0440\u0430\u043d\u044b \u0441 \u0446\u0435\u043b\u044c\u044e \u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0437\u0430\u0446\u0438\u0438 \u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0438 \u0438 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u0431\u043e\u043b\u044c\u0448\u0435\u0439 \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u044f\u043c \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u044b\u0445 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u044f\u0442\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0440\u043e\u0449\u0430\u043b\u044c\u043d\u044b\u0439 \u043c\u0430\u0442\u0447 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%BE%D1%85%D0%B8%D0%BD,_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u043b\u043e\u0445\u0438\u043d, \u041e\u043b\u0435\u0433 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u041e\u043b\u0435\u0433\u0430 \u0411\u043b\u043e\u0445\u0438\u043d\u0430<\/a>: \u0441\u0431\u043e\u0440\u043d\u0430\u044f \u0421\u0421\u0421\u0420 \u0432\u0441\u0442\u0440\u0435\u0442\u0438\u043b\u0430\u0441\u044c \u0441\u043e \u0441\u0431\u043e\u0440\u043d\u043e\u0439 \u043c\u0438\u0440\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1991_%D0%B3%D0%BE%D0%B4\" title=\"1991 \u0433\u043e\u0434\">1991<\/a><ul><li>\u00ab\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044c\u0441\u043a\u0430\u044f \u041e\u0440\u0430\u0442\u043e\u0440\u0438\u044f\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D0%BA%D0%B0%D1%80%D1%82%D0%BD%D0%B8,_%D0%9F%D0%BE%D0%BB\" title=\"\u041c\u0430\u043a\u043a\u0430\u0440\u0442\u043d\u0438, \u041f\u043e\u043b\">\u041f\u043e\u043b\u0430 \u041c\u0430\u043a\u043a\u0430\u0440\u0442\u043d\u0438<\/a> \u043f\u0440\u043e\u0437\u0432\u0443\u0447\u0430\u043b\u0430 \u0432 \u0410\u043d\u0433\u043b\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0421\u043e\u0431\u043e\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B5%D1%80%D0%BF%D1%83%D0%BB%D1%8C\" title=\"\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044c\">\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044f<\/a>. \u041c\u0430\u043a\u043a\u0430\u0440\u0442\u043d\u0438 \u043d\u0430\u043f\u0438\u0441\u0430\u043b \u044d\u0442\u0443 90-\u043c\u0438\u043d\u0443\u0442\u043d\u0443\u044e \u0440\u0430\u0431\u043e\u0442\u0443 \u0432 \u0441\u043e\u0430\u0432\u0442\u043e\u0440\u0441\u0442\u0432\u0435 \u0441 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u043c \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%8D%D0%B2%D0%B8%D1%81,_%D0%9A%D0%B0%D1%80%D0%BB_(%D0%BA%D0%BE%D0%BC%D0%BF%D0%BE%D0%B7%D0%B8%D1%82%D0%BE%D1%80)\" title=\"\u0414\u044d\u0432\u0438\u0441, \u041a\u0430\u0440\u043b (\u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440)\">\u041a\u0430\u0440\u043b\u043e\u043c \u0414\u044d\u0432\u0438\u0441\u043e\u043c<\/a>, \u0432 \u0447\u0435\u0441\u0442\u044c \u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043d\u0438\u044f 150-\u0439 \u0433\u043e\u0434\u043e\u0432\u0449\u0438\u043d\u044b \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0424\u0438\u043b\u0430\u0440\u043c\u043e\u043d\u0438\u0438 \u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044f.<\/li><li>\u041d\u0430 46-\u043c (\u0437\u0430\u043a\u043b\u044e\u0447\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u043c) \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 \u0441\u0435\u0441\u0441\u0438\u0438 \u0421\u042d\u0412 (\u0421\u043e\u0432\u0435\u0442 \u042d\u043a\u043e\u043d\u043e\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0412\u0437\u0430\u0438\u043c\u043e\u043f\u043e\u043c\u043e\u0449\u0438) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%B4%D0%B0%D0%BF%D0%B5%D1%88%D1%82\" title=\"\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\">\u0411\u0443\u0434\u0430\u043f\u0435\u0448\u0442\u0435<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b \u043e\u0431 \u0443\u043f\u0440\u0430\u0437\u0434\u043d\u0435\u043d\u0438\u0438 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1993_%D0%B3%D0%BE%D0%B4\" title=\"1993 \u0433\u043e\u0434\">1993<\/a>&#160;\u2014 \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0430\u0442\u0432\u0438\u044f\">\u041b\u0430\u0442\u0432\u0438\u0439\u0441\u043a\u043e\u0433\u043e<\/a> \u043a\u043e\u043c\u0438\u0442\u0435\u0442\u0430 \u043f\u043e \u0434\u0435\u043d\u0435\u0436\u043d\u043e\u0439 \u0440\u0435\u0444\u043e\u0440\u043c\u0435 \u0441 \u044d\u0442\u043e\u0433\u043e \u0434\u043d\u044f \u0432 \u0434\u0435\u043d\u0435\u0436\u043d\u044b\u0445 \u0440\u0430\u0441\u0447\u0451\u0442\u0430\u0445 \u0441\u043e\u0432\u0435\u0440\u0448\u0451\u043d \u043f\u043e\u043b\u043d\u044b\u0439 \u043f\u0435\u0440\u0435\u0445\u043e\u0434 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D1%82%D0%B2%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BB%D0%B0%D1%82\" title=\"\u041b\u0430\u0442\u0432\u0438\u0439\u0441\u043a\u0438\u0439 \u043b\u0430\u0442\">\u043b\u0430\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%B0%D1%8F_%D1%80%D0%B0%D0%B4%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B\" class=\"mw-redirect\" title=\"\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u0430\u044f \u0440\u0430\u0434\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u044b\">\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u0430\u044f \u0420\u0430\u0434\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a> \u0437\u0430 \u043e\u0434\u043d\u0443 \u043d\u043e\u0447\u044c \u043f\u0440\u0438\u043d\u044f\u043b\u0430 \u043d\u043e\u0432\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%8B\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0423\u043a\u0440\u0430\u0438\u043d\u044b\">\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1997_%D0%B3%D0%BE%D0%B4\" title=\"1997 \u0433\u043e\u0434\">1997<\/a>&#160;\u2014 \u0437\u0430 30 \u0441\u0435\u043a\u0443\u043d\u0434 \u0434\u043e \u043a\u043e\u043d\u0446\u0430 \u0442\u0440\u0435\u0442\u044c\u0435\u0433\u043e \u0440\u0430\u0443\u043d\u0434\u0430 \u044d\u043a\u0441-\u0447\u0435\u043c\u043f\u0438\u043e\u043d \u043c\u0438\u0440\u0430 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BA%D1%81\" title=\"\u0411\u043e\u043a\u0441\">\u0431\u043e\u043a\u0441\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B9%D1%81%D0%BE%D0%BD,_%D0%9C%D0%B0%D0%B9%D0%BA\" title=\"\u0422\u0430\u0439\u0441\u043e\u043d, \u041c\u0430\u0439\u043a\">\u041c\u0430\u0439\u043a \u0422\u0430\u0439\u0441\u043e\u043d<\/a>, \u043e\u0431\u0438\u0436\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 \u0437\u0430\u0449\u0438\u0449\u0430\u0432\u0448\u0435\u0433\u043e \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0441\u043a\u0438\u0439 \u0442\u0438\u0442\u0443\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D0%BB%D0%B8%D1%84%D0%B8%D0%BB%D0%B4,_%D0%AD%D0%B2%D0%B0%D0%BD%D0%B4%D0%B5%D1%80\" title=\"\u0425\u043e\u043b\u0438\u0444\u0438\u043b\u0434, \u042d\u0432\u0430\u043d\u0434\u0435\u0440\">\u042d\u0432\u0430\u043d\u0434\u0435\u0440\u0430 \u0425\u043e\u043b\u0438\u0444\u0438\u043b\u0434\u0430<\/a> \u0437\u0430 \u0443\u0434\u0430\u0440 \u0433\u043e\u043b\u043e\u0432\u043e\u0439 \u0432 \u043b\u0438\u0446\u043e, \u0432\u043f\u0438\u043b\u0441\u044f \u0432 \u0435\u0433\u043e \u0443\u0445\u043e \u0438 \u043e\u0442\u043a\u0443\u0441\u0438\u043b \u043a\u0443\u0441\u043e\u0447\u0435\u043a. \u0411\u043e\u0439 \u0431\u044b\u043b \u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d, \u043d\u043e \u043f\u043e\u0441\u043b\u0435 \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f \u0422\u0430\u0439\u0441\u043e\u043d\u0443 \u0440\u0435\u0444\u0435\u0440\u0438 \u041b\u0435\u0439\u043d \u0440\u0430\u0437\u0440\u0435\u0448\u0438\u043b \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u044c \u0441\u043e\u0440\u0435\u0432\u043d\u043e\u0432\u0430\u043d\u0438\u0435&#160;\u2014 \u0438 \u043d\u043e\u0432\u044b\u0439 \u043a\u0443\u0441\u043e\u043a \u0443\u0445\u0430 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430 \u043e\u043a\u0430\u0437\u0430\u043b\u0441\u044f \u0432 \u0437\u0443\u0431\u0430\u0445 \u0422